def start_fetching_plant_data(queue):
    for reduced_plant_list in split_list_in_n_parts(plant_list, 500):
        _thread.start_new_thread(fetch_plants_data, (queue, reduced_plant_list,))

def fetch_plants_data(queue, plant_list):
    for plant_id in plant_list:
        plant_data = get_plant_data(plant_id)
        if plant_data:
            print(plant_data)
            queue.put((plant_data['waterEndTime'].timestamp(), plant_data))
    print("Done fetching Data")
    
def start_discord_client(discord_client):
    discord_client.run("ODc5MTg4MDc5NDk0MjAxNDE0" + ".YSMFtA.pXE9j1rwiBU-r5bdHHowSLMtAfI") # Separate the API Key to avoid github alert

def split_list_in_n_parts(list, chunk_size):
    return [list[i:i + chunk_size] for i in range(0, len(list), chunk_size)]

